import '../styles/Add.css';
import { LINK } from 'react-router-dom';
function Add() {
    return (
        <div className="form">
        <input type="text" placeholder="Player Name" id="playerName" name="playerName"/>
        <input type="text" placeholder="Matches played" id="matchedPlayed" name="matchedPlayed"/>
        <input type="text" placeholder="Total kills" id="kills" name="kills"/>
        <input type="text" placeholder="Matches Won" id="matchWon" name="matchWon"/>
        <input type="text" placeholder="Most used Weapon" id="weapon" name="weapon"/>
        <button><LINK to="/read">Insert Player Record</LINK></button>
      </div>
    )
  }
  
  export default Add
